import request from '@/utils/request'; //供应商报价查询

export function queryRecords(query) {
  return request({
    url: "/business/quote-notification",
    method: 'get',
    params: query
  });
} // 供应商报价提交

export function submitRecords(data) {
  return request({
    url: '/business/quote-notification/oper',
    method: 'patch',
    data: data
  });
}
